def format_data(station,dataframe):
    dataframe.rename(columns={'January':1, 'February':2, 'March':3, 'April':4, 'May':5, 'June':6,
       'July':7, 'August':8, 'September':9, 'October':10, 'November':11, 'December':12},inplace=True)
    df=dataframe[dataframe['Area']==station]
    df['Year']=df['Year'].astype(int)
    df=df.tail(20)
    month=[]
    for j in range(len(df)):
        for i in range(1,13):
            month.append([station,'{}'.format(df.iloc[j]['Year'])+'-{}'.format(i),df.iloc[j][i]])
                
    formated=pd.DataFrame(month,columns=['Station','Date',"Value"])
    formated['Date']=pd.to_datetime(formated['Date'],infer_datetime_format=True)
    indexedformated=formated.set_index(['Date'])
    return indexedformated


