    scaler = StandardScaler().fit(X)
    rescaled_X = scaler.transform(X)
    Y=train_df.loc[train_row,'Production']
    model= xgb.XGBRegressor(gamma=0, learning_rate=0.25, max_depth=9, min_child_weight=1)
